import React from 'react';
import Link from 'next/link';
import { Avatar } from 'antd';


const navLink = [
    {
        title: 'HOME',
        path:'/'
    },
    {
        title: 'PRODUCTS',
        path:'/products'
    },
    {
        title: 'CARTS',
        path:'/carts'
    },
    {
        title: 'SIGNIN',
        path:'/signin'
    },
    {
        title: 'SIGNUP',
        path:'/signup'
    }
]

function Navigation() {
    return(
        <nav className="site-navigation">
            <span className="menu-title">Cubiz Store</span>
           <div className="menu-content-container">
                <ul>
                        { navLink.map((link, index) => (
                            <li key={index}>
                                <Link href={link.path}>
                                    <a>{link.title}</a>
                                </Link>
                            </li>
                        ))
                        }
                    </ul>
                    <span>
                        <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" size={40} />
                        <span className="menu-avatar-name">Loki Developer</span>
                    </span>
           </div>
        </nav>
    )
}

export default Navigation;
